.wrapper {
  width: 100%;
  max-width: 1040px;
  margin: 0 auto;
}
html {
  font-family: 'Roboto', sans-serif;
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: 'Roboto Mono', monospace;
  font-weight: 700;
}
img {
  max-width: 100%;
  height: auto;
}

sources.src/scss/_stack.scss:
.stack {
  padding: 4rem 0;

  margin-top: 8rem;
  &__heading {
    font-size: 2rem;
    line-height: 3rem;
    &-description {
      margin-top: 1.8rem;
    }
  }
  &__container {
    column-count: 3;
    column-gap: 3.8rem;
    margin-top: 4rem;
    text-transform: uppercase;
  }
  &__element {
    -webkit-column-break-inside: avoid; /* Chrome, Safari, Opera */
    page-break-inside: avoid; /* Firefox */
    break-inside: avoid; /* IE 10+ */

    display: flex;
    padding: 1em 0;
    align-items: center;
    &-icon {
      margin-right: 1em;
    }
  }
}

sources.src/scss/_header.scss:
.header {
  position: fixed;
  width: 100%;
  z-index: 5;
  display: flex;
  align-items: center;
  background-color: #fff;
}

sources.src/scss/_nav.scss:
.nav {
  width: 100%;
  max-width: 1280px;
  height: 5rem;
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 auto;
  &__list {
    font-family: 'Roboto Mono', monospace;
    display: flex;
    align-items: center;
    &-element {
      margin-right: 3rem;
    }
  }
}

sources.src/scss/_about.scss:
.about {
  width: 100%;
  display: flex;
  flex: 0;
  justify-content: space-between;
  align-items: center;
  &__container {
    display: flex;
  }
  &__description {
    align-self: center;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: flex-start;
    &-heading {
      font-size: 3.3rem;
      line-height: 4rem;
    }
    &-paragraph {
      font-size: 1.3rem;
      margin-top: 2.5rem;
      line-height: 2rem;
    }
    &-link {
      display: flex;
      align-items: center;
      border: 1px solid #000;
      padding: 0.6rem 2.3rem;
      border-radius: 10px;
      margin-top: 3.1rem;
    }
    &-icon {
      margin-left: 0.8rem;
    }
  }
}

sources.src/scss/_projects.scss:
.projects {
  width: 100%;
  margin-top: 8rem;
  &__heading {
    font-size: 2rem;
    line-height: 3rem;
  }
  &__container {
    display: flex;
    flex-wrap: wrap;
    justify-content: space-between;
    min-height: 80vh;
  }
}

sources.src/scss/_project.scss:
.project {
  width: 300px;
  height: 15rem;
  border: 1px solid #e7e7e7;
  padding: 0.5em 1em;
  margin-top: 2em;
  &__heading {
    display: flex;
    justify-content: flex-start;
    align-items: center;
  }
  &__more {
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    border-color: transparent;
    &-link {
      display: flex;
      align-items: flex-end;
      margin-top: 1em;
      border: 1px solid #000;
      padding: 0.5rem 2.3rem;
      border-radius: 10px;
    }
  }
}

sources.src/scss/_contact.scss:
.contact {
  margin-top: 2rem;
  min-height: 40vh;
  display: flex;
  justify-content: space-between;
  &__social {
    display: flex;
    flex-direction: column;
    &-link:not(:first-child) {
      margin-top: 2rem;
    }
  }
  &__heading {
    font-size: 2rem;
    line-height: 3rem;
  }
}
